'investment_data AS (',
'    SELECT ',
'        VALOR_APLICADO, ',
'        TAXA_NEGOCIADA, ',
'        DATA_INVESTIMENTO, ',
'        quem ',
'    FROM ',
'        investimentos',
'    WHERE ',
'        (REGEXP_LIKE(quem, :QUEM)',
'        OR REGEXP_LIKE(quem, :P2_INVESTIDOR))',
'        AND STATUS = ''ATIVO''',
