'),',
'compounded_values AS (',
'    SELECT ',
'        md.month_date,',
'        SUM(ROUND(calcular_juros_compostos(',
'            id.VALOR_APLICADO,',
'            id.TAXA_NEGOCIADA,',
'            (TRUNC(md.month_date) - TRUNC(id.DATA_INVESTIMENTO)) / 365,',
'            12',
'        ), 2)) AS valor_atual',
'    FROM ',
'        month_data md',
'    JOIN ',
'        investment_data id ON 1 = 1',
'    GROUP BY ',
'        md.month_date',
')',
'SELECT ',
'    TO_CHAR(month_date, ''DD/MM/YYYY'') AS "Date", ',
'    valor_atual AS "Value"',
'FROM ',
'    compounded_values',
'ORDER BY ',
'    month_date ASC;',
