,p_plug_display_sequence=>30
,p_query_type=>'SQL'
,p_plug_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'SELECT ',
'    I.ID,',
'    I.TIPO_DE_INVESTIMENTO,',
unistr('    C."DESCRI\00C7\00C3O",'),
'    I.VENCIMENTO,',
'    (I.TAXA_NEGOCIADA * 100) AS TAXA_NEGOCIADA,',
'    I.QUANTIDADE,',
'    TO_CHAR(I.VALOR_APLICADO, ''999G999D99'') AS VALOR_APLICADO,',
'    I.QUEM,',
'    I.DATA_INVESTIMENTO,',
'    CASE ',
'        WHEN I.VENCIMENTO < SYSDATE THEN ''ATIVO VENCIDO''',
unistr('        WHEN I.VENCIMENTO <= ADD_MONTHS(SYSDATE, 6) THEN ''VENCIMENTO PR\00D3XIMOS 6 MESES'''),
'        ELSE TO_CHAR(EXTRACT(YEAR FROM I.VENCIMENTO))',
'    END AS ANO_OU_VENCIMENTO,',
'    EXTRACT(YEAR FROM I.DATA_INVESTIMENTO) AS ANO_INVESTIMENTO,',
'    I.VALOR_ATUAL,',
'    I.VALOR_PROJETADO,',
'    I.STATUS,',
'    CASE ',
'        WHEN arquivo IS NOT NULL THEN ''ARQUIVO NO SISTEMA''',
'        ELSE ''ARQUIVO PENDENTE''',
'    END AS ARQUIVO_STATUS,',
'    I.CORRETORA,',
'    C.GRUPO_ACIONARIO',
'FROM ',
'    INVESTIMENTOS I, CONTROLE_ACIONARIO C',
'WHERE ',
'    I.CONTROLE_ACIONARIO_ID = C.ID AND',
'    REGEXP_LIKE(quem, :INVESTIDOR)',
'ORDER BY ',
'    I.DATA_INVESTIMENTO DESC;',
''))
