'        ',
'        DBMS_SCHEDULER.CREATE_JOB (',
'            job_name        => ''PERSONAL.'' || :P9_USERNAME || ''_VENC6MESES'',',
'            job_type        => ''PLSQL_BLOCK'',',
'            job_action      => ''BEGIN vencimento6meses('''''' || :P9_USERNAME || '''''', '''''' || :P9_EMAIL || ''''''); END;'',',
