'	"ARQUIVO_MIMETYPE" VARCHAR2(512), ',
'	"ARQUIVO_DATA" TIMESTAMP (6), ',
'	"CORRETORA" VARCHAR2(300), ',
'	"CONTROLE_ACIONARIO_ID" NUMBER, ',
'	 PRIMARY KEY ("ID")',
'  USING INDEX  ENABLE',
'   ) ;',
'',
'  CREATE TABLE "CONTROLE_ACIONARIO" ',
'   (	"ID" NUMBER GENERATED BY DEFAULT AS IDENTITY MINVALUE 1 MAXVALUE 9999999999999999999999999999 INCREMENT BY 1 START WITH 20 CACHE 20 NOORDER  NOCYCLE  NOKEEP  NOSCALE  NOT NULL ENABLE, ',
unistr('	"DESCRI\00C7\00C3O" VARCHAR2(3000), '),
'	"GRUPO_ACIONARIO" VARCHAR2(400), ',
'	 CONSTRAINT "PK_CONTROLE_ACIONARIO" PRIMARY KEY ("ID")',
'  USING INDEX  ENABLE',
'   ) ;',
'',
'  ALTER TABLE "INVESTIMENTOS" ADD CONSTRAINT "FK_CONTROLE_ACIONARIO" FOREIGN KEY ("CONTROLE_ACIONARIO_ID")',
'	  REFERENCES "CONTROLE_ACIONARIO" ("ID") ENABLE;',
'create or replace FUNCTION calcular_juros_compostos ( ',
'    principal IN NUMBER, ',
'    taxa_juros IN NUMBER, ',
'    num_periodos IN NUMBER, ',
'    composicoes_por_periodo IN NUMBER ',
') RETURN NUMBER DETERMINISTIC IS ',
'    montante NUMBER; ',
'BEGIN ',
'    montante := principal * POWER(1 + (taxa_juros / composicoes_por_periodo), num_periodos * composicoes_por_periodo); ',
'    RETURN montante; ',
'END; ',
