'/',
'create or replace FUNCTION Get_CDI_Hoje RETURN VARCHAR2 IS',
'    l_http_request  UTL_HTTP.req;',
'    l_http_response UTL_HTTP.resp;',
'    l_response_text CLOB;',
'    l_buffer        VARCHAR2(32767);',
'    l_html_text     CLOB;',
'    l_pattern       VARCHAR2(100) := ''<p>CDI Hoje: <strong class="variation">(.*?)</strong>%</p>'';',
'    l_cdi_value     VARCHAR2(100);',
'BEGIN',
'    -- Initialize temporary CLOB for the response',
'    DBMS_LOB.createtemporary(l_response_text, TRUE);',
'',
'    -- Initialize HTTP request with User-Agent header',
'    l_http_request := UTL_HTTP.begin_request(''https://investidor10.com.br/indices/'', ''GET'', ''HTTP/1.1'');',
'    UTL_HTTP.set_header(l_http_request, ''User-Agent'', ''Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/91.0.4472.124 Safari/537.36'');',
'    l_http_response := UTL_HTTP.get_response(l_http_request);',
'',
'    -- Read the response',
'    BEGIN',
'        LOOP',
'            UTL_HTTP.read_text(l_http_response, l_buffer, 32767);',
'            DBMS_LOB.writeappend(l_response_text, LENGTH(l_buffer), l_buffer);',
'        END LOOP;',
'    EXCEPTION',
'        WHEN UTL_HTTP.end_of_body THEN',
'            UTL_HTTP.end_response(l_http_response);',
'    END;',
'',
'    -- Store HTML content in a CLOB variable',
'    l_html_text := l_response_text;',
'',
'    -- Extract the CDI Hoje value using regular expressions',
'    SELECT REGEXP_SUBSTR(l_html_text, l_pattern, 1, 1, NULL, 1) INTO l_cdi_value FROM dual;',
'',
'    -- Clean up temporary LOB',
'    DBMS_LOB.freetemporary(l_response_text);',
'',
'    -- Return the extracted CDI value',
'    RETURN TRIM(l_cdi_value);',
'',
'EXCEPTION',
'    WHEN OTHERS THEN',
'        IF DBMS_LOB.istemporary(l_response_text) = 1 THEN',
'            DBMS_LOB.freetemporary(l_response_text);',
'        END IF;',
'        RAISE;',
'END;',
'/',
'create or replace FUNCTION get_investments(p6_new IN VARCHAR2)',
'RETURN SYS_REFCURSOR',
'IS',
'    v_sql    VARCHAR2(4000);',
'    cur      SYS_REFCURSOR;',
'BEGIN',
'    v_sql := ''SELECT ID,',
'                     TIPO_DE_INVESTIMENTO,',
unistr('                     "DESCRI\00C7\00C3O",'),
'                     VENCIMENTO,',
'                     TAXA_NEGOCIADA,',
'                     QUANTIDADE,',
'                     VALOR_APLICADO,',
'                     QUEM,',
'                     DATA_INVESTIMENTO,',
'                     VALOR_ATUAL,',
'                     VALOR_PROJETADO,',
'                     STATUS',
'              FROM INVESTIMENTOS '';',
'              ',
'    IF p6_new != ''PERSONAL'' THEN',
'        v_sql := v_sql || ''WHERE REGEXP_LIKE(QUEM, :P6_NEW) '';',
'    END IF;',
'    ',
'    v_sql := v_sql || ''ORDER BY DATA_INVESTIMENTO DESC'';',
'',
'    -- Print the SQL statement',
'    DBMS_OUTPUT.PUT_LINE(v_sql);',
'',
'    -- Open the cursor with the generated SQL statement',
'    OPEN cur FOR v_sql USING p6_new;',
'    RETURN cur;',
'END;',
