'create or replace PROCEDURE arquivopendente (',
'    p_quem IN VARCHAR2, ',
'    p_email IN VARCHAR2',
') AS',
'    CURSOR investimentos_cur IS',
'        SELECT I.TIPO_DE_INVESTIMENTO, ',
unistr('               C.DESCRI\00C7\00C3O, '),
'               I.VENCIMENTO, ',
'               round((I.TAXA_NEGOCIADA * 100),2) AS TAXA_NEGOCIADA, ',
'               I.QUANTIDADE, ',
'               I.VALOR_APLICADO, ',
'               I.QUEM, ',
'               I.DATA_INVESTIMENTO, ',
'               I.VALOR_ATUAL, ',
'               I.VALOR_PROJETADO, ',
'               I.STATUS, ',
'               I.corretora ',
'        FROM INVESTIMENTOS I, CONTROLE_ACIONARIO C ',
'        WHERE I.CONTROLE_ACIONARIO_ID = C.ID AND',
'            I.arquivo IS NULL ',
'          AND I.QUEM = p_quem;',
'',
'    v_investimento VARCHAR2(4000);',
'    v_email_body   VARCHAR2(32767);',
'',
'    p_id_workspace    VARCHAR2(4000);',
'    l_workspace_id    NUMBER := NULL;',
'    ',
'    l_investment_found BOOLEAN := FALSE;',
'',
'BEGIN',
'    p_id_workspace := ''10979034347205586'';',
'',
'    v_email_body := ''<html><body>'';',
'    v_email_body := v_email_body || ''<h2>Arquivos de Controle Pendentes no Sistema:</h2>'';',
'',
'    l_workspace_id := apex_util.find_security_group_id(p_workspace => p_id_workspace);',
'    apex_util.set_security_group_id(p_security_group_id => l_workspace_id);',
'',
'    FOR rec IN investimentos_cur LOOP',
'        l_investment_found := TRUE;',
'        v_investimento := ''<strong>Tipo:</strong> '' || rec.TIPO_DE_INVESTIMENTO || ''<br>'' ||',
unistr('                          ''<strong>Descri\00E7\00E3o:</strong> '' || rec.DESCRI\00C7\00C3O || ''<br>'' ||'),
'                          ''<strong>Vencimento:</strong> '' || TO_CHAR(rec.VENCIMENTO, ''DD-MM-YYYY'') || ''<br>'' ||',
'                          ''<strong>Taxa Negociada (a.a.):</strong> '' || rec.TAXA_NEGOCIADA || ''% <br>'' ||',
'                          ''<strong>Quantidade:</strong> '' || rec.QUANTIDADE || ''<br>'' ||',
'                          ''<strong>Valor Aplicado:</strong> '' || rec.VALOR_APLICADO || ''<br>'' ||',
'                          ''<strong>Quem:</strong> '' || rec.QUEM || ''<br>'' ||',
'                          ''<strong>Data Investimento:</strong> '' || TO_CHAR(rec.DATA_INVESTIMENTO, ''DD-MM-YYYY'') || ''<br>'' ||',
'                          ''<strong>Valor Atual:</strong> '' || rec.VALOR_ATUAL || ''<br>'' ||',
'                          ''<strong>Valor Projetado:</strong> '' || rec.VALOR_PROJETADO || ''<br>'' ||',
'                          ''<strong>Status:</strong> '' || rec.STATUS || ''<br><br>'';',
'        v_email_body := v_email_body || v_investimento;',
'    END LOOP;',
'',
'    IF l_investment_found THEN',
'        v_email_body := v_email_body || ''</body></html>'';',
'',
'        APEX_MAIL.SEND(p_from => ''noreply@investimentos.publicvm.com'',',
'                       p_to   => p_email,',
'                       p_cc        => ''caiogusto@hotmail.com'',',
'                       p_subj => ''Arquivos Pendentes no Sistema'',',
'                       p_body => v_email_body,',
'                       p_body_html => v_email_body);',
'    END IF;',
'',
'    COMMIT;',
'END;',
